import "./components.css";

const ExpPage = () =>{
    return(
        <div className="ExpPage">
            <h1>VI Characteristics of a Diode</h1>
            <div className="tools">
                <div className="theory">Theory</div>
                <div className="procedure">Procedure</div>
                <div className="perform">Perform</div>
            </div>
            <div className="theoryshow">
                
            </div>
        </div>
    )
}

export default ExpPage;


















